/**
 * @param {number[]} nums
 * @param {number} k
 * @return {number}
 */
var minIncrementOperations = function(nums, k) {
    let operations = 0, max = 0;
    for (let i = 0; i < nums.length; i++) {
        max = Math.max(max, nums[i]);
        if (i >= 2) {
            if (max < k) {
                operations += k - max;
                max = k;
            }
            if (nums[i - 2] === max) {
                max = Math.max(nums[i - 1], nums[i]);
                for (let j = i - 3; j >= 0 && nums[j] === nums[i - 2]; j--) {
                    max = Math.max(max, nums[j]);
                }
            }
        }
    }
    return operations;
};
